import React from "react";
import { Input } from "antd";

const { Search } = Input;

function Home() {
  const onSearch = (value) => {
    console.log(value);
  };
  return (
    <div>
      <Search
        className="search"
        enterButton="Search"
        placeholder="Search for a movie, tv show, ..."
        onSearch={onSearch}
        size="large"
      />
    </div>
  );
}

export default Home;
